import React, { useState, useCallback } from 'react';

const FONT_SEMIBOLD = 'data:font/otf;base64,';
const FONT_REGULAR = 'data:font/otf;base64,';

const PALETTE = {
  noir: '#1C1917',
  blanc: '#F2F0E9',
  violet: '#7C3AED',
  sable: '#D4C8B8',
};

const THEMES = {
  dark: { bg: PALETTE.noir, text: PALETTE.blanc },
  light: { bg: PALETTE.blanc, text: PALETTE.noir },
  violet: { bg: PALETTE.violet, text: PALETTE.blanc },
  sable: { bg: PALETTE.sable, text: PALETTE.noir },
};

// ============================================
// LIBRAIRIE D'ILLUSTRATIONS - jsDelivr CDN
// Pour ajouter : upload sur GitHub, puis ajouter une ligne ici
// ============================================
const CDN = 'https://cdn.jsdelivr.net/gh/Faraoniq/blog-thumbnail-automation@main/Illustrations';

const ILLUSTRATIONS = [
  { id: 'none', name: 'Aucune', url: '' },
  { id: 'stadium-white', name: 'Stade (blanc)', url: CDN + '/white.png' },
  { id: 'stadium-black', name: 'Stade (noir)', url: CDN + '/black.png' },
  { id: 'stadium-purple', name: 'Stade (violet)', url: CDN + '/purple.png' },
  { id: 'data-08', name: 'Data 08', url: CDN + '/data-08.png' },
  { id: 'data-09', name: 'Data 09', url: CDN + '/data-09.png' },
  { id: 'data-10', name: 'Data 10', url: CDN + '/data-10.png' },
  { id: 'data-11', name: 'Data 11', url: CDN + '/data-11.png' },
  { id: 'data-12', name: 'Data 12', url: CDN + '/data-12.png' },
  { id: 'data-13', name: 'Data 13', url: CDN + '/data-13.png' },
  { id: 'data-14', name: 'Data 14', url: CDN + '/data-14.png' },
  { id: 'data-15', name: 'Data 15', url: CDN + '/data-15.png' },
];

const POSITIONS = [
  { id: 'top-left', label: 'Haut-gauche', style: { top: '40px', left: '40px' } },
  { id: 'top-center', label: 'Haut-centr', style: { top: '40px', left: '50%', transform: 'translateX(-50%)' } },
  { id: 'top-right', label: 'Haut-droit', style: { top: '40px', right: '40px' } },
  { id: 'center-left', label: 'Centr-gauche', style: { top: '50%', left: '40px', transform: 'translateY(-50%)' } },
  { id: 'center', label: 'Centr', style: { top: '50%', left: '50%', transform: 'translate(-50%, -50%)' } },
  { id: 'center-right', label: 'Centr-droit', style: { top: '50%', right: '40px', transform: 'translateY(-50%)' } },
  { id: 'bottom-left', label: 'Bas-gauche', style: { bottom: '40px', left: '40px' } },
  { id: 'bottom-center', label: 'Bas-centr', style: { bottom: '40px', left: '50%', transform: 'translateX(-50%)' } },
  { id: 'bottom-right', label: 'Bas-droit', style: { bottom: '40px', right: '40px' } },
];

const CANVAS = { width: 752, height: 500 };

const SAFE_COMBOS = [
  { text: 'bottom-left', image: 'top-right' },
  { text: 'bottom-left', image: 'center-right' },
  { text: 'bottom-right', image: 'top-left' },
  { text: 'bottom-right', image: 'center-left' },
  { text: 'top-left', image: 'bottom-right' },
  { text: 'top-left', image: 'center-right' },
  { text: 'top-right', image: 'bottom-left' },
  { text: 'top-right', image: 'center-left' },
];

const getTextAlign = (posId) => {
  if (posId.includes('left')) return 'left';
  if (posId.includes('right')) return 'right';
  return 'center';
};

export default function ThumbnailGenerator() {
  const [fontsLoaded, setFontsLoaded] = useState(false);
  const [title, setTitle] = useState('Votre titre ici');
  const [subtitle, setSubtitle] = useState('');
  const [theme, setTheme] = useState('dark');
  const [textPosition, setTextPosition] = useState('bottom-left');
  const [imagePosition, setImagePosition] = useState('top-right');
  const [selectedIllustration, setSelectedIllustration] = useState(() => { const avail = ILLUSTRATIONS.filter(i => i.id !== 'none'); return avail[Math.floor(Math.random() * avail.length)].id; });
  const [imageSize, setImageSize] = useState(450);
  const [imageOffsetX, setImageOffsetX] = useState(0);
  const [imageOffsetY, setImageOffsetY] = useState(0);

  React.useEffect(() => {
    const loadFonts = async () => {
      const semibold = new FontFace('SuisseIntl', `url(${FONT_SEMIBOLD})`, { weight: '600' });
      const regular = new FontFace('SuisseIntl', `url(${FONT_REGULAR})`, { weight: '400' });
      await Promise.all([semibold.load(), regular.load()]);
      document.fonts.add(semibold);
      document.fonts.add(regular);
      setFontsLoaded(true);
    };
    loadFonts();
  }, []);

  const currentTheme = THEMES[theme];
  const textPosData = POSITIONS.find(p => p.id === textPosition);
  const imagePosData = POSITIONS.find(p => p.id === imagePosition);
  const imageUrl = ILLUSTRATIONS.find(i => i.id === selectedIllustration)?.url || '';

  const randomize = useCallback(() => {
    const themes = Object.keys(THEMES);
    setTheme(themes[Math.floor(Math.random() * themes.length)]);
    const combo = SAFE_COMBOS[Math.floor(Math.random() * SAFE_COMBOS.length)];
    setTextPosition(combo.text);
    setImagePosition(combo.image);
    setImageSize(180 + Math.floor(Math.random() * 120));
    const availableIllus = ILLUSTRATIONS.filter(i => i.id !== 'none');
    if (availableIllus.length > 0) {
      setSelectedIllustration(availableIllus[Math.floor(Math.random() * availableIllus.length)].id);
      setImageOffsetX(0);
      setImageOffsetY(0);
    }
  }, []);

  const handleExport = () => {
    const canvas = document.createElement('canvas');
    canvas.width = CANVAS.width;
    canvas.height = CANVAS.height;
    const ctx = canvas.getContext('2d');

    ctx.fillStyle = currentTheme.bg;
    ctx.fillRect(0, 0, CANVAS.width, CANVAS.height);

    const getCanvasPos = (posId, size = 0) => {
      const p = 40;
      const positions = {
        'top-left': { x: p, y: p },
        'top-center': { x: CANVAS.width/2 - size/2, y: p },
        'top-right': { x: CANVAS.width - p - size, y: p },
        'center-left': { x: p, y: CANVAS.height/2 - size/2 },
        'center': { x: CANVAS.width/2 - size/2, y: CANVAS.height/2 - size/2 },
        'center-right': { x: CANVAS.width - p - size, y: CANVAS.height/2 - size/2 },
        'bottom-left': { x: p, y: CANVAS.height - p - size },
        'bottom-center': { x: CANVAS.width/2 - size/2, y: CANVAS.height - p - size },
        'bottom-right': { x: CANVAS.width - p - size, y: CANVAS.height - p - size },
      };
      return positions[posId];
    };

    const drawText = () => {
      const pos = getCanvasPos(textPosition, 0);
      const align = getTextAlign(textPosition);
      ctx.fillStyle = currentTheme.text;
      ctx.font = '600 48px SuisseIntl, sans-serif';
      const letterSpacing = -0.025 * 48;
      
      const maxWidth = 400;
      const words = title.split(' ');
      let lines = [], currentLine = '';
      words.forEach(word => {
        const testLine = currentLine + (currentLine ? ' ' : '') + word;
        if (ctx.measureText(testLine).width > maxWidth && currentLine) {
          lines.push(currentLine);
          currentLine = word;
        } else currentLine = testLine;
      });
      lines.push(currentLine);
      
      let x = pos.x;
      if (align === 'right') x = CANVAS.width - 40;
      if (align === 'center') x = CANVAS.width / 2;
      
      const yOffset = textPosition.includes('bottom') ? -((lines.length - 1) * 56) : 48;
      
      lines.forEach((line, i) => {
        let xPos = x;
        const yPos = pos.y + yOffset + (i * 56);
        if (align === 'center' || align === 'right') {
          const lineWidth = [...line].reduce((w, c) => w + ctx.measureText(c).width + letterSpacing, -letterSpacing);
          xPos = align === 'center' ? x - lineWidth/2 : x - lineWidth;
        }
        for (let char of line) {
          ctx.fillText(char, xPos, yPos);
          xPos += ctx.measureText(char).width + letterSpacing;
        }
      });
      
      if (subtitle) {
        ctx.font = '400 20px SuisseIntl, sans-serif';
        ctx.textAlign = align;
        ctx.fillText(subtitle, x, pos.y + yOffset + (lines.length * 56) + 8);
      }
    };

    const doExport = () => {
      const link = document.createElement('a');
      link.download = 'thumbnail.png';
      link.href = canvas.toDataURL('image/png');
      link.click();
    };

    if (imageUrl) {
      const img = new Image();
      img.crossOrigin = 'anonymous';
      img.onload = () => {
        const iPos = getCanvasPos(imagePosition, imageSize);
        ctx.drawImage(img, iPos.x + imageOffsetX, iPos.y + imageOffsetY, imageSize, imageSize);
        drawText();
        doExport();
      };
      img.onerror = () => { drawText(); doExport(); };
      img.src = imageUrl;
    } else {
      drawText();
      doExport();
    }
  };

  const inputStyle = { width: '100%', padding: '10px', borderRadius: '6px', border: '1px solid #ccc', fontFamily: 'inherit', fontSize: '14px' };
  const labelStyle = { display: 'block', fontWeight: '600', marginBottom: '6px', fontSize: '14px' };

  if (!fontsLoaded) return <div style={{ padding: '40px', textAlign: 'center' }}>Chargement...</div>;

  return (
    <div style={{ fontFamily: 'SuisseIntl, sans-serif', padding: '24px', maxWidth: '1200px', margin: '0 auto' }}>
      <style>{`
        @font-face { font-family: 'SuisseIntl'; src: url(${FONT_SEMIBOLD}); font-weight: 600; }
        @font-face { font-family: 'SuisseIntl'; src: url(${FONT_REGULAR}); font-weight: 400; }
      `}</style>
      
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '24px' }}>
        <h1 style={{ fontSize: '24px', fontWeight: '600', margin: 0 }}>Gnrateur de Thumbnails</h1>
        <button onClick={randomize} style={{ padding: '10px 20px', backgroundColor: '#fff', border: '2px solid '+PALETTE.noir, borderRadius: '8px', fontWeight: '600', cursor: 'pointer' }}>
           Alatoire
        </button>
      </div>
      
      <div style={{ display: 'flex', gap: '32px', flexWrap: 'wrap' }}>
        <div style={{ width: CANVAS.width, height: CANVAS.height, backgroundColor: currentTheme.bg, borderRadius: '8px', position: 'relative', overflow: 'hidden', flexShrink: 0 }}>
          {imageUrl && (
            <img src={imageUrl} alt="" style={{ position: 'absolute', width: imageSize, height: imageSize, objectFit: 'contain', ...imagePosData.style, transform: `translate(${imageOffsetX}px, ${imageOffsetY}px)` }} />
          )}
          <div style={{ position: 'absolute', maxWidth: 400, color: currentTheme.text, textAlign: getTextAlign(textPosition), ...textPosData.style }}>
            <div style={{ fontSize: 48, fontWeight: 500, lineHeight: 1.15, letterSpacing: '-0.025em' }}>{title}</div>
            {subtitle && <div style={{ fontSize: 20, fontWeight: 400, marginTop: 12 }}>{subtitle}</div>}
          </div>
        </div>

        <div style={{ display: 'flex', flexDirection: 'column', gap: '16px', minWidth: '300px' }}>
          <div>
            <label style={labelStyle}>Titre</label>
            <textarea value={title} onChange={(e) => setTitle(e.target.value)} style={{ ...inputStyle, minHeight: '70px' }} />
          </div>
          <div>
            <label style={labelStyle}>Sous-titre</label>
            <input type="text" value={subtitle} onChange={(e) => setSubtitle(e.target.value)} style={inputStyle} />
          </div>
          <div>
            <label style={labelStyle}>Thme</label>
            <div style={{ display: 'flex', gap: '8px' }}>
              {Object.entries(THEMES).map(([key, t]) => (
                <button key={key} onClick={() => setTheme(key)} style={{ width: 44, height: 44, borderRadius: '8px', backgroundColor: t.bg, border: theme === key ? '3px solid #7C3AED' : '2px solid #ccc', cursor: 'pointer' }} title={key} />
              ))}
            </div>
          </div>
          <div>
            <label style={labelStyle}>Position du texte</label>
            <select value={textPosition} onChange={(e) => setTextPosition(e.target.value)} style={inputStyle}>
              {POSITIONS.map(p => <option key={p.id} value={p.id}>{p.label}</option>)}
            </select>
          </div>
          <div>
            <label style={labelStyle}>Illustration</label>
            <select value={selectedIllustration} onChange={(e) => setSelectedIllustration(e.target.value)} style={inputStyle}>
              {ILLUSTRATIONS.map(i => <option key={i.id} value={i.id}>{i.name}</option>)}
            </select>
          </div>
          <div>
            <label style={labelStyle}>Position de l'illustration</label>
            <select value={imagePosition} onChange={(e) => setImagePosition(e.target.value)} style={inputStyle}>
              {POSITIONS.map(p => <option key={p.id} value={p.id}>{p.label}</option>)}
            </select>
          </div>
          <div>
            <label style={labelStyle}>Taille: {imageSize}px</label>
            <input type="range" min={100} max={700} value={imageSize} onChange={(e) => setImageSize(Number(e.target.value))} style={{ width: '100%' }} />
          </div>
          <div>
            <label style={labelStyle}>Ajuster position</label>
            <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3, 40px)', gap: '4px', justifyContent: 'center' }}>
              <div />
              <button onClick={() => setImageOffsetY(y => y - 20)} style={{ padding: '8px', border: '1px solid #444', borderRadius: '4px', background: '#222', color: '#fff', cursor: 'pointer' }}></button>
              <div />
              <button onClick={() => setImageOffsetX(x => x - 20)} style={{ padding: '8px', border: '1px solid #444', borderRadius: '4px', background: '#222', color: '#fff', cursor: 'pointer' }}></button>
              <button onClick={() => { setImageOffsetX(0); setImageOffsetY(0); }} style={{ padding: '8px', border: '1px solid #444', borderRadius: '4px', background: '#333', color: '#fff', cursor: 'pointer', fontSize: '10px' }}></button>
              <button onClick={() => setImageOffsetX(x => x + 20)} style={{ padding: '8px', border: '1px solid #444', borderRadius: '4px', background: '#222', color: '#fff', cursor: 'pointer' }}></button>
              <div />
              <button onClick={() => setImageOffsetY(y => y + 20)} style={{ padding: '8px', border: '1px solid #444', borderRadius: '4px', background: '#222', color: '#fff', cursor: 'pointer' }}></button>
              <div />
            </div>
          </div>
          <button onClick={handleExport} style={{ padding: '14px 24px', backgroundColor: PALETTE.violet, color: '#fff', border: 'none', borderRadius: '8px', fontWeight: '600', fontSize: '16px', cursor: 'pointer', marginTop: '8px' }}>
            Exporter PNG
          </button>
        </div>
      </div>
    </div>
  );
}
